import React from 'react';
import Header from './components/Header';
import Portfolio from './components/Portfolio';

function App() {
  return (
    <div className="App">
        <Header/>
        <div className='f-heading'>
          <h1>Portfolio</h1>
          <p>You can find sample sites I made for other businesses and individuals here.</p>
        </div>
        <Portfolio/>

      </div>
  );
}

export default App;
